Comment:
1) atraso para iniciar o procedimento;
2) no momento do procedimento as funcionárias ficaram gritando, rindo e conversando enquanto os produtos agiam no meu rosto = zero relaxamento;)
3) música alta tocando no som da clínica, normalmente quando fazemos limpeza de pele o clima fica agradável e não com música alta;
4) por ser um ambiente de saúde as pessoas deveriam usar máscara e nem os próprios funcionários usavam. 

Não volto mais.

Dia 01/02 (12h30) realizei uma das 4 limpezas de pele que deixei pagas em novembro, na black friday e, como de costume nesse local, tive uma péssima experiência. O que ocorreu foi uma série de ações que infringiam noções básicas de biossegurança e de atenção com o assistido.  
Para listar: 
- profissional de cabelos SOLTOS e SEM touca; 
- profissional com máscara abaixo do nariz;
- profissional mexendo no celular enviando mensagens de texto, inclusive, com volume alto; 
- procedimento iniciado sem os materiais necessários em sala, o que fazia com que ela tivesse que sair a cada etapa -- o que acabava contaminando, visto que ela não trocava ou retirava a luva para pegar nos materiais em outro local e nem na maçaneta da porta;
- profissional que desrespeitava as etapas da limpeza, fazendo com que resquícios dos produtos ficassem no rosto se misturando uns com os outros;
- utilização de agulha para literalmente "rasgar a pele", o que acabou por formar ferida;
- agulha apoiada no papel descartável da maca sem nenhuma preocupação com contaminação; 
- ausência da caixa de pérfuro-cortantes na sala;
- ausência de assepsia no aparelho de "alta frequência", além de ter levado um "choque" que foi banalizado pela profissional ao rir e dizer que era "assim mesmo". 

Enfim, experiência terrível e não foi a primeira vez! Da última vez com essa profissional, saí com o rosto inteiro machucado. Inclusive, tenho fotos. 

Péssimo!
